note_models.css:
@font-face {
   font-family: 'kanji_strokeorder';
   font-style: normal;
   font-weight: 400;
   src: url(_KanjiStrokeOrders.ttf) format('truetype');
 }

@font-face {
   font-family: 'IPAGothic';
   font-style: normal;
   font-weight: 400;
   src: url(_ipag.ttf) format('truetype');
 }
body {
margin: 0;
}
.container {
display: flex;
flex-direction: column;
height: 100vh;
}
.card-content {
flex: 1;
padding: 20px;
padding-top:0;
}
.footer {
	padding: 20px;
	padding-bottom: 10px;
	padding-top:0px;
}
.card {
	margin-top: 0px;
	height: 100%;
	font-family:  Helvetica, "IPAGothic", Arial,Verdana,sans-serif;
}
.card p {
	padding: 0;
	position: relative;
}
.card p.kanji{
	padding-top:60px;
	font-size: 70px;
   	font-family: IPAGothic;
	color:#5E81AC;
	height:20vh;
	line-height:0px;
}
.card p.kanji i {
	font-family: Helvetica, IPAGothic;
	color:#4C566A;
	font-size: 20px;
	padding-left: 5px;
	font-style: normal;
}
.card p.kanji b {
	font-family: Helvetica;
	color:#4C566A;
	font-size: 20px;
	font-weight:normal;
}
.card p.kanji_card2{
	padding-top:30px;
	font-size: 70px;
	line-height:0;
   	font-family:IPAGothic;
	color:#5E81AC;
}
.card p.kanji_card2 i {
	font-family: Helvetica, IPAGothic;
	color:#4C566A;
	font-size: 16px;
	padding-left: 5px;
	font-style: normal;
}
.card p.kanji_card2 b {
	font-family: Helvetica;
	color:#4C566A;
	font-size: 20px;
	font-weight:normal;
}
.card p.kanji_back{
	font-size: 20px;
   	font-family: IPAGothic;
	color: #8FBCBB;
	padding-top:10px;
	line-height:0px;
	height:5vh;
}
.card p.kanji_back i {
	font-family: Helvetica, IPAGothic;
	color:#4C566A;
	font-size: 16px;
	font-style: normal;
}
.card p.kanji_back b {
	font-family: Helvetica;
	color:#4C566A;
	font-size: 16px;
	font-weight: normal;
}
.card p.primitive_correction before {
	content: "- ";
	padding-left: 5px;
	color:#4C566A;
}
.card #compounds {
	font-size: 20px;
	text-decoration: none;
	color: #8FBCBB;
}
.card #compounds i{
	font-style: normal;
	font-size: 22px;
	text-decoration: none;
	color: #5E81AC;
}
.card #explanation{
	min-height:15vh;
	font-size: 20px;
	text-align:left;
	color:#2E3440;
}
.card #explanation i{
	font-style:normal;
	color: #BF616A;
}
.card #explanation b{
	font-weight:normal;
	color:#5E81AC;
}
.card #notes {
	font-size:16px;
	color:#4C566A;
}
.card #notes u{
	font-size:20px;
	text-decoration: none;
}
.card p.meaning {
	font-size: 40px;
	color:#5E81AC;
	line-height:30px;
}
.card p.meaning i {
	font-style: normal;
 	font-size: 12px;
	color:#2E3440;
	height:5vgh;
}
.card p.meaning_back{
	font-size: 20px;
	font-family: Helvetica, Arial;
	color: #5E81AC;
	max-height:1vh;
}
.card p.meaning_back i {
	font-family: Helvetica, IPAGothic;
	color:#4C566A;
	font-size: 16px;
	font-style: normal;
}
#no {
	color:#4C566A;
	font-family: Helvetica,Arial,Verdana,sans-serif;
	font-size: 20px;
	text-align:right;
	float:right;
}
#JDIC a{
	text-style:normal;
	top:0;
	color:#4C566A;
	font-family: Helvetica,Arial,Verdana,sans-serif;
	font-size: 20px;
	text-align:right;
	float:right;
	padding-top:10px;
}
#lesson {
	color:#4C566A;
	font-family: Helvetica,Arial,Verdana,sans-serif;
	font-size: 20px;
	text-align:left;
	float:left;
}

/* NIGHT MODE THEMING*/
.card.night_mode p.kanji{
	color:#8FBCBB;
}
.card.night_mode p.kanji i {
	color:#4C566A;
}
.card.night_mode p.kanji_card2{
	color:#8FBCBB;
}
.card.night_mode p.kanji_card2 i {
	color:#4C566A;
}
.card.night_mode p.kanji_back{
	color: #5E81AC;
}
.card.night_mode p.kanji_back i {
	color:#4C566A;
}
.card.night_mode p.primitive_correction before {
	color:#4C566A;
}
.card.night_mode #compounds {
	color: #5E81AC;
}
.card.night_mode #compounds i{
	color: #8FBCBB;
}
.card.night_mode #explanation{
	color:#ECEFF4;
}
.card.night_mode #explanation i{
	color: #D08770;
}
.card.night_mode #explanation b{
	color:#8FBCBB;
}
.card.night_mode #notes {
	color:#4C566A;
}
.card.night_mode p.meaning {
	color:#8FBCBB;
}
.card.night_mode p.meaning i {
	color:#E5E9F0;
}
.card.night_mode p.meaning_back{
	color: #5E81AC;
}
.card.night_mode p.meaning_back i {
	color:#4C566A;
}
.card.night_mode #no {
	color:#4C566A;
}
.card.night_mode #lesson {
	color:#4C566A;
}
/* ANDROID SETTINGS */
.android .container {
	height: 97vh; /*AnkiDroid seems to calculate vh with area below buttons*/
}
.android .card p.kanji{
	font-size:120px;
}
.android.card.night_mode {
	background-color:#000000;
}
.android .card p.kanji_card2{
	font-size:120px;
}
